Надувной детский бассейн Bestway FastSet 183х51 см, 940 л будет готов к летнему сезону в кратчайшие сроки! Просто выберите ровную поверхность, надуйте верхнее кольцо, и бассейн будет подниматься по мере наполнения водой. Прочная подкладка Tritech изготовлена из прочного материала, усиленного для обеспечения прочности и устойчивости к проколам. По окончании сезона его легко хранить. Ваше лето не будет полным без бассейна Bestway FastSet!

- Объем бассейна (80%): 940 л;
- Установка за 10 минут;
- Боковые стенки из материала Tritech, 3-х слойного материала, состоящего из слоев износостойкого ПВХ и полиэстера;
- Чаша бассейна поддерживается надувным верхним кольцом;
- Для детей от 6 лет;
- Размер183x183x51см;
- Вес в упаковке 3,031кг;
- Габариты упаковки 19 см x 19 см x 19 см.

Необыкновенно яркий и красивый надувной бассейн "Звезды с кругом и мячом" от компании INTEX предназначен для самостоятельной игры детей от 2 лет. Материал безопасен и прочен.

Характеристики бассейна:

Размеры бассейна - диаметр 122 см, высота бортиков 25 см. Дно не надувное.

Объем - 150 литров при наполнении на 80%.

Вес - 0,9 кг.

В комплект входят:

бассейн;

надувной круг - диаметр 51 см;

надувной мячик - диаметр 51 см;

Предназначен для детей от 2 лет.

Детский надувной бассейн порадует самых маленьких членов семьи и сделает отдых на природе увлекательным. Поставить такую конструкцию можно даже на неподготовленную поверхность. Это займёт около 10 минут: разверните полотно, надуйте кольцо и заполните водой.

Характеристики:

- толщина материала стенок: 0,20 мм;
- толщина материала пола: 0,18 мм
- возраст: от 1 до 3 лет;
- объём наполнения водой: 33 л.

Облако – детский надувной бассейн 142х119х84 см, 82 л – все, что то, что нужно ребёнку в летнюю жару. Предусмотрен навес по типу радуги от прямых лучей солнца. Глубина – небольшая, Отлично подойдет для ребенка. Яркая радуга и необычная форма бассейна в виде облачка привлекут внимание даже самых капризных малышей. Подарит живительную прохладу, защитит от солнца. Можно быстро превратить в игровой центр, если заполнить емкость пластиковыми шариками. Низкие, широкие бортики высотой 13 см не позволят ребенку упасть. Материал – прочный, гипоаллергенный, безопасный винил. Прослужит долго, не утратит форму. Радуга надувается отдельно от основания.

• размер - 142х119х84 см;

• емкость воды - 82 л;

• тип дна - не надувной

Надувной бассейн сможет подарить малышу радость летом и зимой. Используйте этот бассейн в любое время года: летом на природе ребёнок может плескаться и радоваться брызгам, а зимой можно наполнить бассейн шариками и использовать его как игровой манеж. Имеет мягкие стенки с широким бортиком, оберегающие от ударов и травм, и жесткое дно из ПВХ-пленки. 
Характеристики:
- размер: 61х15 см;
- объём: 21 л;
- не надувное дно.
Насос в комплект не входит.

