Бассейн с надувным бортом - это развлечение для всей семьи. С этим бассейном вы сможете насладиться бодрящим досугом и разнообразить привычные будни.
Бассейн прост в установке:
Необходимо достать бассейн из коробки, разместить на ровной очищенной поверхности, надуть верхнее кольцо и  налить воды. По мере её добавления кольцо станет подниматься, и бассейн примет окончательный вид. 
На холодное время года не рекомендуем оставлять бассейн на открытом воздухе. Удобный сливной клапан позволяет присоединить садовый шланг, что дает возможность слить воду в любое место.
Характеристики:
- размер: 183х51 см;
- объём: 940 л;
- не надувное дно;
- сливной клапан есть.
Насос в комплект не входит.

