Надувной бассейн - это прекрасный яркий детский бассейн, который напоминает расцветкой радугу. Безопасен в использовании, доставит вашим детям множество радости. Детский бассейн имеет мягкие яркие надувные бортики, они не только добавят комфорта, но и уберегут вашего ребенка от травм. Чтобы дети не скучали, можете добавить в бассейн немного надувных игрушек. Сливной клапан облегчает слив воды. Просто взять в путешествие. Компактный и лёгкий.
Характеристики:
- не надувное дно;
- объем: 780 л;
- размеры: 168х46 см.
Насос в комплект не входит.

Лёгкий надувной бассейн быстро устанавливается на площадке. Наполните его, и ваша малышка будет купаться в нагретой солнцем воде в любое время. В конструкции сделано мягкое надувное дно. Бассейн с яркой расцветкой станет для крохи любимым местом для игр.
Характеристики:
- размер рыбки: 70 х 24 см;
- объём: 41 л;
- дно: надувное.
Насос в комплект не входит.

