Яркий, красочный и многофункциональный детский центр для игр с водой Солнышко оснащен всеми необходимыми элементами.
Центральная фонтанная брызгалка делает бассейн великолепным местом для игр, в котором можно плескаться или просто сидеть. Особенности: легко подсоединяется к садовому шлангу; съемная горка со встроенными кольцами и шнурами для привязывания ее к бассейну;
вода из бассейна спускается с помощью простого в использовании сливного клапана; предохранительные клапаны; прочный предварительно испытанный винил; в комплект входит ремонтная заплата; содержимое: один бассейн, одна горка, ремонтная заплата.

Ванночка надувная Радуга имеет яркий дизайн и подойдёт для детей до 2 лет.
Особенности:
предохранительные клапаны;
надувной ребристый пол придает больший комфорт и предотвращает подскальзывание;
отличный выбор для путешествий - легко надувать и сдувать;
термометр в виде рыбки может использоваться в качестве детской игрушки; его можно также использовать для контроля температуры воды;
встроенный в дно мягкий упор предотвращает соскальзывание ребенка.

