Яркий и прочный бассейн с надувным дном - это не только радостные эмоции ребёнка, но и украшение загородного участка. Приятный дизайн в виде красочных надувных колец и рифлёного надувного дна не оставит равнодушными даже взрослых. С этим бассейном малыш сможет разучить новые игры, освежиться в летний зной и избавиться от боязни воды. Не беспокойтесь о безопасности малыша: мягкие бортики уберегут ребёнка от травм.
Характеристики:
размер: 61х22;
надувное дно;
толщина материала стенок: 0,20 мм;
толщина материала пола: 0,18 мм;
объём наполнения водой: 28 л;
рекомендуется детям от 1 до 3 лет.

